import React from 'react';
import Style from './Portfolio.module.css'
import Link from 'react-router-dom'


function Portfolio() {
  return (
    <div>
      <div className={Style.fundo}>
        <div>

          <Link />

        </div>
      </div>
    </div>
  );
}

export default Portfolio;
